import React from "react";

import "../css/Project.css";

function Project(props) {
  return (
    <div className="Project">
      <dl>
        <dt>Scuoler LMS for Schools/Universities</dt>
        Link: <a href="https://scuoler.com">https://scuoler.com</a>
        <br />
        Technologies: HTML, CSS, Javascript, React, Node, Express, Rest APIs,
        PostgreSQL, Sockets.IO, Web RTC, Fontawsome, Material UI
        <dd>- white cold drink</dd>
        <dt>Milk</dt>
      </dl>
    </div>
  );
}

export default Project;
